// src/components/Dashboard.js
import React from 'react';
import './Dashboard.css';

const Dashboard = () => {
    // Sample data for the interviews
    const interviews = [
        {
            id: 1,
            interviewer: 'Dr. Aditi Sharma',
            candidate: 'Rahul Verma',
            date: '2024-10-12',
            time: '10:00 AM'
        },
        {
            id: 2,
            interviewer: 'Mr. Sanjay Gupta',
            candidate: 'Anjali Singh',
            date: '2024-10-15',
            time: '02:00 PM'
        },
        {
            id: 3,
            interviewer: 'Ms. Priya Kumar',
            candidate: 'Vikram Joshi',
            date: '2024-10-18',
            time: '11:30 AM'
        }
    ];

    return (
        <div className="dashboard">
            <h2>Interview Dashboard</h2>
            <table>
                <thead>
                    <tr>
                        <th>Interviewer</th>
                        <th>Candidate</th>
                        <th>Date</th>
                        <th>Time</th>
                    </tr>
                </thead>
                <tbody>
                    {interviews.map((interview) => (
                        <tr key={interview.id}>
                            <td>{interview.interviewer}</td>
                            <td>{interview.candidate}</td>
                            <td>{interview.date}</td>
                            <td>{interview.time}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Dashboard;
